import LoginForm from "./LoginForm/LoginForm";
import LoginHeader from "./LoginHeader/LoginHeader";

function LoginPanel() {
  return (
    <div className="container">
        <div className="wrapper">

          <LoginHeader></LoginHeader>

          <LoginForm></LoginForm>
        </div>
      </div>
  )
}

export default LoginPanel;
